--
-- Table structure for table `m_skpd`
--

DROP TABLE IF EXISTS `m_skpd`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `m_skpd` (
  `id_skpd` tinyint(3) NOT NULL AUTO_INCREMENT COMMENT 'id dari tiap-tiap unit',
  `id_bidkoor` tinyint(2) DEFAULT NULL,
  `kode_skpd` char(10) DEFAULT NULL COMMENT 'kode dari setiap unit',
  `kodepos_skpd` char(5) DEFAULT NULL COMMENT 'kode digit yang dimiliki oleh unit',
  `nama_skpd` varchar(255) DEFAULT NULL COMMENT 'nama yang dimiliki oleh unit',
  `alamat` varchar(255) DEFAULT 'Klungkung' COMMENT 'alamat dari masing-masing unit',
  `telp_skpd` varchar(12) DEFAULT NULL,
  `fax` varchar(12) DEFAULT NULL,
  `orderby` int(11) DEFAULT '999',
  `kaskpd_nama` varchar(255) DEFAULT 'nama kepala' COMMENT 'nama dari kepala SKPD',
  `kaskpd_nip` varchar(255) DEFAULT 'nip kepala' COMMENT 'nip dari kepala SKPD',
  `nama_jabatan` varchar(255) DEFAULT NULL,
  `pangkat_golongan` varchar(50) DEFAULT NULL,
  `kode_unit` varchar(45) DEFAULT NULL,
  `kode_urusan` varchar(45) DEFAULT NULL,
  `kode_bidang` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id_skpd`)
) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

