-- Table structure for table `m_users_bu`
--

DROP TABLE IF EXISTS `m_users_bu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `m_users_bu` (
  `id_user` int(5) NOT NULL AUTO_INCREMENT COMMENT 'id yang dimiliki oleh user',
  `username` varchar(40) DEFAULT NULL COMMENT 'username yang dimiliki oleh user',
  `password` varchar(32) DEFAULT NULL COMMENT 'password yang dimiliki oleh user',
  `id_group` tinyint(3) DEFAULT NULL COMMENT 'foreign key dari tabel master group',
  `kategori` varchar(100) DEFAULT NULL COMMENT 'kategori hak akses dari user itu sendiri',
  `id_kategori` tinyint(3) DEFAULT NULL COMMENT 'id kategori yang dimiliki oleh user',
  `user_active` int(11) DEFAULT NULL COMMENT 'status keaktifan dari user',
  `user_nama` varchar(256) DEFAULT NULL COMMENT 'nama lengkap dari user',
  `user_unit` varchar(4) DEFAULT NULL COMMENT 'unit asal dari user',
  `id_skpd` tinyint(3) DEFAULT NULL,
  `id_desa` tinyint(3) DEFAULT NULL,
  `id_kecamatan` tinyint(3) DEFAULT NULL,
  `user_email` varchar(50) DEFAULT NULL COMMENT 'email yang dimiliki user',
  `user_phone` varchar(50) DEFAULT NULL COMMENT 'no telepon yang dimiliki user',
  `user_lastvisit` datetime DEFAULT NULL COMMENT 'mencatat waktu mengenai kapan user terakhir login ',
  `user_online` int(11) DEFAULT NULL COMMENT 'menyatakan status online user',
  `user_lastsession` datetime DEFAULT NULL COMMENT 'mencatat waktu berakhirnya login session user',
  PRIMARY KEY (`id_user`),
  UNIQUE KEY `username` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=138 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

